import "./Header.css";
export default function Header({ items }) {
  return (
    <>
      <header>
        <div className="header">
          <a href="#" class="logo">
            Shopping Website
          </a>
          <div className="link">
            <a href="#">Home</a>
            <a href="#">About us</a>
          </div>
          <div className="login">
            <button>Login</button>
            <button className="signup">Signup</button>
          </div>
        </div>
      </header>
      {console.log(items)}
    </>
  );
}
